  \"2015-09-27T01:53:53.455688\",\n\t\"name\": \"temperature-salinity-and-other-variables-collected-from-discrete-sample-and-profile-observationa3bbe\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0115682 includes chemical,
  discrete sample, physical and profile data collected from METEOR in the North Atlantic
  Ocean from 2003-06-26 to 2003-07-21 and retrieved during cruise CARINA/06MT20030626
  and WOCE AR04. These data include CHLOROFLUOROCARBON-11 (CFC-11), CHLOROFLUOROCARBON-12
  (CFC-12), HYDROSTATIC PRESSURE, Potential temperature (theta), SALINITY, SULFUR
  HEXAFLUORIDE (SF6) and WATER TEMPERATURE. The instruments used to collect these
  data include CTD and bottle. These data were collected by J. Mortensen of Institute
  of Marine Research - Norway as part of the CARINA/06MT20030626, WOCE AR04 data set.nnThe
  CARINA (CARbon dioxide IN the Atlantic Ocean) data synthesis project is an international
  collaborative effort of the EU IP CARBOOCEAN, and U.S. partners. It has produced
  a merged internally consistent data set of open ocean subsurface measurements for
  biogeochemical investigations, in particular, studies involving the carbon system.
  The original focus area was the North Atlantic Ocean, but over time the geographic
  extent expanded and CARINA now includes data from the entire Atlantic, the Arctic
  Ocean, and the Southern Ocean.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
